  \"High Capacity Nano-Composite Cathodes for Human-Rated Lithium-Ion Batteries Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 6,\n\t\t\"recent\": 2\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-06T21:39:54.935065\",\n\t\"name\": \"high-capacity-nano-composite-cathodes-for-human-rated-lithium-ion-batteries-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Non-incremental improvements are necessary
  in lithium-ion batteries order to meet future space applications demands such as
  NASA's call for lithium-ion battery cathodes with specific capacity values exceeding
  240mAh/g at C/2 discharge rate and 25:C. Novel concepts for lithium-ion battery
  chemistry and/or design are therefore desired. Yardney Technical Products, Inc.
  proposes a development of an advanced nano-composite cathode, based on two crucial
  components, each performing a different vital function:rn&amp;#61607;tThe first
  component, a layered non-transition oxide material will provide the matrix of the
  composite and ensure that the cathode voltage falls above ~4.0V.rn&amp;#61607;tThe
  metallic nano-particulate domains, dispersed uniformly within the layered oxide
  matrix will provide the composite cathode with a potentially high specific capacity.
  Metallic nanoparticles are expected to form an in-situ oxide phase upon cycling
  in a lithium ion battery.rnThe composite electrode material may be coated with a
  thin layer of carbon in order to enhance the electronic conductivity of the as-synthesized
  composite electrode.rnrn\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
